    "Contaminants in redhead ducks wintering in Baffin Bay and Redfish Bay, Texas",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:41:54.165160",nt"name": "contaminants-in-redhead-ducks-wintering-in-baffin-bay-and-redfish-bay-texas",nt"isopen":
    false,nt"url": null,nt"notes": "A sample of 39 redhead ducks was collected
    from Redfish and Baffin Bays on the Texas Coast during the winter of 1988-1989 to
    obtain baseline information on contaminant concentrations and determine if contaminant
    levels changed over winter. The sample was distributed approximately evenly between
    sexes, bays, and two collection periods (early and late winter). Redhead breast
    muscle was analyzed for organochlorines and livers were analyzed for trace elements.
    A11 organochlorines were below detection in breast muscle. Boron, copper, molybdenum
    and selenium accumulated in redheads utilizing Redfish Bay. Silver accumulated in
    redheads wintering at both bays. The concentrations of boron, molybdenum, and selenium
    were generally below levels considered harmful. The concentrations of copper and
    silver in some redheads were elevated when compared to other studies, however, the
    biological significance of these concentrations is presently unknown. Lead was found
    at concentrations known to be acutely toxic in two redheads collected from Redfish
    Bay and may be the result of ingested lead-shot.",nt"license_title": "License
